import React from 'react';

const Topics = () => {
    const match = useRouteMatch();
    return (
        <div>
            <Switch>
                <Route path={`${match.url}/:topicid`}>
                    <Topic />
                </Route>
                <Route path={`${match.url}`}>
                    <TopicList />
                </Route>
            </Switch>
        </div>
    );
};

export default Topics;
